import { 
  MODIFY_SORT,
  MODIFY_SORT_ORDER
 } from '../constants/action-types'

export function modifySort(payload) {
  return {
    type: MODIFY_SORT,
    payload
  }
}

export function modifySortOrder(payload) {
  return {
    type: MODIFY_SORT_ORDER,
    payload
  }
}
